Cyclings Greatest Fraud
The story behind one of the most epic falls from grace in sporting history, featuring new interviews with members of Armstrong's inner circle. Vicious Cycle tells the story of Lance Armstrong's epic fall from grace as one of the world's greatest athletes. Guided by the extensive U.S. Anti-Doping Agency report, this documentary special pieces together the eyewitness testimony and delves into the science to show how the doping plot allegedly began and then mushroomed in its complexity. Using infographics, re-creations and archival footage, discover what the report says about how Armstrong and others outfoxed drug testing officials.

